import React from "react";
import { Text, StyleSheet, View, Button, TouchableOpacity } from "react-native";

const HomeScreen = ({ navigation }) => {
	return (
		<View>
			<Text style={styles.text}>This is my first text</Text>
			<Button
				style={styles.button}
				title="Home"
				color="red"
				onPress={() => navigation.navigate("Home")}
			/>
			<TouchableOpacity onPress={() => navigation.navigate("List")}>
				<Text style={styles.button}>List Component</Text>
			</TouchableOpacity>
		</View>
	);
};

const styles = StyleSheet.create({
	text: {
		fontSize: 30,
	},
	button: {
		padding: 8,
		textAlign: "center",
		backgroundColor: "red",
		marginHorizontal: 5,
		marginVertical: 5,
		borderRadius: 40,
		width: "50%",
		fontSize: 19,
		color: "#fff",
	},
});

export default HomeScreen;
